def test_PlopRotTempGroup(input_file):
    try:
        os.remove(os.path.join(REPOS_PATH,'LIG'))
        os.remove(os.path.join(REPOS_PATH,'LIG.rot.assign'))

    except OSError:
        pass
   
    subprocess.call([PYTHON_PATH, MAIN_PATH, os.path.join(TEST_PATH, input_file)])

    if not os.path.isfile(os.path.join(REPOS_PATH,'LIG.rot.assign')):
      assert 0

    if not os.path.isfile(os.path.join(REPOS_PATH,'LIG')):
      assert 0



