    old_NBND_sections, new_NBND_sections = test.compare_NBND_sections(old_sections, new_sections)

    differences = False
    for i, (old_section, new_section) in enumerate(zip(old_NBND_sections, new_NBND_sections)):
      for old_param, new_param, name in zip(old_section, new_section, NAMES):
        if(float(old_param) != 0):
          convergence_factor = (float(old_param)-float(new_param))/float(old_param)
          if(name == 'alpha' and float(old_param) == 1.685851020 and float(new_param) == -2.220205820):
            pass
          elif( convergence_factor > TRESHOLD or float(old_param)==0):
            print('[{}, {}, {}, {}]'.format(test.old_names[i], name, old_param, new_param))
            differences = True
        elif(new_param!=old_param):
            print('[{}, {}, {}, {}]'.format(test.old_names[i], name, old_param, new_param))
            differences = True   
    if differences:
      assert 0 

