def test_PlopRotTemp_TOR_Param(input_file):


    test = PlopTest(input_file)

    old_sections, new_sections  = test.run_versions()

    BND_old_sect, BND_new_sect = test.compare_BND_sections(old_sections, new_sections, 'TOR')


    differences = False
    for i, new_bond in enumerate(BND_new_sect):
        if(new_bond not in BND_old_sect):
            print(new_bond)
            differences = True
    if differences:
      assert 0

